import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [apiResponse, setApiResponse] = useState('');

  useEffect(() => {
    // Test API connection
    fetch('http://localhost:5000/api/test')
      .then(res => res.json())
      .then(data => setApiResponse(data.message))
      .catch(err => setApiResponse('Error connecting to API'));
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h1>vHealth App</h1>
        <p>API Status: {apiResponse}</p>
      </header>
    </div>
  );
}

export default App;
